import {combineReducers} from "@reduxjs/toolkit";
import * as contactFeature from './contacts/contacts.slice';

const rootReducer = combineReducers({
    [contactFeature.contactsFeatureKey]: contactFeature.contactSlice.reducer
})
export default rootReducer;
